import {FaTimes} from "react-icons/all";
import React from "react";

const DeleteButton =({ stock, onDelete })=>{
    return (
        <FaTimes style={{ color:'red', cursor: 'pointer' }} onClick={ () => onDelete(stock) }/> 
    )
}
export default DeleteButton
